import React from 'react';
import { useNavigate } from "react-router-dom";

const navigate = useNavigate();

function logOut(){
  navigate('/login');
}

const Logout = () => {
  return (
    <button onClick={logOut}>Logout</button>
  )
}

export default Logout;
